import clsx from 'clsx'
import styles from './button.module.css'

function ButtonBtn({ primary }) {
    const classes = clsx(styles.btn, {
        [styles.pri]: true
    })
    return (
        <>
            <div>
                <button className={styles.btn}>CLick Me</button>

            </div>
        </>
    )
}
export default ButtonBtn;
